import React from 'react';
import './SolutionPage.css';

export default function AIReceptionist() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">AI Receptionist</h1>
      <p className="solution-desc">Rosie acts as your smart AI receptionist, greeting callers, answering questions, and scheduling appointments with a friendly, human-like touch.</p>
      <div className="solution-section">
        <h2>AI Receptionist Features</h2>
        <ul>
          <li>Custom greetings for your business</li>
          <li>Appointment scheduling</li>
          <li>Instant notifications for every call</li>
        </ul>
      </div>
    </div>
  );
}
